A valset is an attestation type representing a validator set change. It allows for the validator set to change over heights which in turn defines which orchestrator should sign the attestations. When an orchestrator sees a newly generated valset published by the Celestia state machine, it queries the previous valset and checks whether it's part of its validator set. Then, the orchestrator signs the new valset and submits that signature to the QGB P2P network . Otherwise, it ignores it and waits for new attestations. A valset is comprised of the following fields: // Valset is the EVM Bridge Multsig Set, each qgb validator also
// maintains an ETH key to sign messages, these are used to check signatures on
// ETH because of the significant gas savings
message Valset { option (cosmos_proto.implements_interface) = "AttestationRequestI"; // Universal nonce defined under: // https://github.com/celestiaorg/celestia-app/pull/464 uint64 nonce = 1; // List of BridgeValidator containing the current validator set. repeated BridgeValidator members = 2 [ (gogoproto.nullable) = false ]; // Current chain height uint64 height = 3; // Block time where this valset was created google.protobuf.Timestamp time = 4 [ (gogoproto.nullable) = false, (gogoproto.stdtime) = true ];
} With BridgeValidator representing a validator EVM address and its power: // BridgeValidator represents a validator's ETH address and its power
message BridgeValidator { // Voting power of the validator. uint64 power = 1; // EVM address that will be used by the validator to sign messages. string evm_address = 2;
} nonce: is the universal nonce of the attestation. It is used to prevent front running attacks in the QGB smart contract. More details can be found in ADR-004 . members: contains the current validator set. height: is the height at which the valset was created. time: is the timestamp of the height at which the valset was created. Validator power normalization The QGB bridge power is obtained by normalizing the validators' voting power using the min-max normalization formula. This formula takes into account the ratio of each validator's voting power to the total voting power in the block and scales it to a value between 0 and 2^32. By normalizing the voting power, we can significantly reduce the frequency of generating new validator set updates. For example, if there is a small increase in the total on-chain voting power due to inflation, there is no need to create a new validator set. This is because the relative proportions of the validators remain the same, and the normalized QGB power doesn't show any significant difference. To ensure that the normalization process doesn't encounter overflow errors, the function normalizeValidatorPower uses BigInt operations. It scales the raw power value with respect to the total validator power, making sure the result falls within the range of 0 to 2^32. This mechanism allows to increase/decrease the frequency at which validator set updates get created via increasing/decreasing the value of the SignificantPowerDifferenceThreshold constant (more details on it below). Power diff PowerDiff(...) is a function that calculates the difference in power between two sets of bridge validators. It's important to note that the power being compared is not the regular voting power in the Celestia consensus network, but a specific type called QGB bridge power (explained above).

