A data commitment is an attestation type representing a request to commit over a set of blocks. It provides an end exclusive range of blocks for orchestrators to sign over and propagate in the QGB P2P network. The range is defined by the param DataCommitmentWindow , more on this below. When an orchestrator sees a newly generated data commitment, it queries the previous valset and checks whether it's part of its validator set. Then, the orchestrator signs the new data commitment and submits that signature to the QGB P2P network . Otherwise, it ignores it and waits for new attestations. A data commitment is comprised of the following fields: // DataCommitment is the data commitment request message that will be signed
// using orchestrators.
// It does not contain a `commitment` field as this message will be created
// inside the state machine and it doesn't make sense to ask tendermint for the
// commitment there.
// The range defined by begin_block and end_block is end exclusive.
message DataCommitment { option (cosmos_proto.implements_interface) = "AttestationRequestI"; // Universal nonce defined under: // https://github.com/celestiaorg/celestia-app/pull/464 uint64 nonce = 1; // First block defining the ordered set of blocks used to create the // commitment. uint64 begin_block = 2; // End exclusive last block defining the ordered set of blocks used to create // the commitment. uint64 end_block = 3; // Block time where this data commitment was created google.protobuf.Timestamp time = 4 [ (gogoproto.nullable) = false, (gogoproto.stdtime) = true ];
} nonce: is the universal nonce of the attestation. It is used to prevent front running attacks in the QGB smart contract. More details can be found in ADR-004 . begin_block: the data commitment range first block. end_block: the data commitment range last block. The range is end exclusive. Thus, the commitment will be over the set of blocks defined by [begin_block, end_block). time: is the timestamp of the height at which the data commitment was created. A commitment, aka DataRootTupleRoot , is an RFC-6962 merkle tree commitment over the set of DataRootTuples defined by a data commitment range. A data root tuple contains the following fields: /// @notice A tuple of data root with metadata. Each data root is associated
/// with a Celestia block height.
/// @dev `availableDataRoot` in
/// https://github.com/celestiaorg/celestia-specs/blob/master/src/specs/data_structures.md#header
struct DataRootTuple { // Celestia block height the data root was included in. // Genesis block is height = 0. // First queryable block is height = 1. uint256 height; // Data root. bytes32 dataRoot; // Celestia block original square size. uint256 squareSize;
} height: the height of the block. dataRoot: the data root, aka data hash, of the block. squareSize: the square size of the block. These commitments are queried by orchestrators from Celestia-core , signed, then submitted to the QGB P2P network as described here .

