The state consists only of the parameters that are protected by the paramfilter. All state is immutable and stored in memory during the application's initialization. // ParamBlockList keeps track of parameters that cannot be changed by governance
// proposals
type ParamBlockList struct { params map[string]bool
} // NewParamBlockList creates a new ParamBlockList that can be used to block gov
// proposals that attempt to change hard-coded parameters.
func NewParamBlockList(blockedParams ...[2]string) ParamBlockList { consolidatedParams := make(map[string]bool, len(blockedParams)) for _, param := range blockedParams { consolidatedParams[fmt.Sprintf("%s-%s", param[0], param[1])] = true } return ParamBlockList{params: consolidatedParams}
}

